function AboutUs()
{
    return (
        <div style={{ backgroundImage: "url(/img/aboutusBG.png)", height: "1600px" }} id="aboutUsBG">
            <p className="display-2" style={{ paddingTop: "129px" }}>Our Mission</p>
            <div>
                <img src="./src/img/logo-dark.png" alt="logo" />
            </div>
        </div>
    )
}

export default AboutUs
